import React from "react";
import Image from "next/image";
import Link from "next/link";
import {
  BannerWrap,
  BannerRight,
  BannerLeft,
  Logo,
  LogoText,
  HeaderItems,
  HeaderItem,
  MainText,
  SubText,
  Arrow,
  FlexArrow,
  ArrowText,
  Piano,
  BannerText,
} from "../styles/Banner";
import ScrollIntoView from "react-scroll-into-view";

import App from "../components/Dynamic";

function Banner() {
  return (
    <BannerWrap>
      <BannerLeft>
        <Logo>
          <Image src="/piano.svg" width={30} height={30} />

          <LogoText>
            <Link href="/">Мелодром</Link>
          </LogoText>
        </Logo>
        <BannerText>
        Дејана Банковић , рођена је 18. новембра 1983.године у Крагујевцу. Основну школу и Основну музичку школу, одсек клавир, завршава у Лапову. Након завршене Средње музичке школе, образовни профил музички извођач/клавириста, завршава Факултет музичке уметности,  смер-општа музичка педагогија. 
            </BannerText>

      </BannerLeft>
      <BannerRight>




      </BannerRight>
    </BannerWrap>
  );
}

export default Banner;
